TABLEATTRIBUTE.VALUE:
select ORDER_STATUS AS ORDER_STATUS, PROD_ORDER_NO AS PROD_ORDER_NO, ACTUAL_DC AS ACTUAL_DC from (select ORDER_STATUS AS ORDER_STATUS, PROD_ORDER_NO AS PROD_ORDER_NO, trim(ACTUAL_DC) AS ACTUAL_DC from ( SELECT LPAD(TO_CHAR(ORDER_STATUS),2,'0') AS ORDER_STATUS, order_no || '-' || lpad( rnk -1,2,'0') AS PROD_ORDER_NO, SRC_STYLE_CD AS STYLE_CD, SRC_COLOR_CD AS COLOR_CD, SRC_ATTRIBUTE_CD AS ATTRIBUTE_CD, SIZE_LN_POS_CD AS SIZE_CD , ACTUAL_DC FROM ( select ORDER_STATUS, src_style_cd, src_color_cd, src_attribute_cd, size_ln_pos_cd , substr(prod_order_no,1,instr(prod_order_no,'_',1,1)-1) order_no, WORKORDER_QTY, rank () over (partition by substr(prod_order_no,1,instr(prod_order_no,'_',1,1)-1), src_style_CD, src_color_cd, src_attribute_cd order by src_size_cd,order_status, WORKORDER_QTY desc ) as rnk , ACTUAL_DC AS ACTUAL_DC from stg_ow_exec_wip_workorder where as_of_date = (select as_of_date from day_dimension where day_date = trunc(sysdate-1))
)
union all select LPAD(TO_CHAR(ORDER_STATUS),2,'0') AS ORDER_STATUS, substr(prod_order_no,1,instr(prod_order_no,'_',1,1)-1) as PROD_ORDER_NO, src_style_cd AS STYLE_CD, src_color_cd AS COLOR_CD, src_attribute_cd AS ATTRIBUTE_CD, size_ln_pos_cd AS SIZE_CD, ACTUAL_DC AS ACTUAL_DC from stg_ow_exec_wip_workorder where as_of_date = (select as_of_date from day_dimension where day_date = trunc(sysdate-1)) ORDER BY STYLE_CD,PROD_ORDER_NO,COLOR_CD,ATTRIBUTE_CD,SIZE_CD,ORDER_STATUS ) tbl union all select ORDER_STATUS_CD as ORDER_STATUS, SUPER_ORDER as PROD_ORDER_NO, DEMAND_LOC AS ACTUAL_DC
from STG_ISS_PROD_ORDER)

